          "title": "Privacy Policy",
          "description": "We, The Coca-Cola Company and its affiliates, take our consumers’ privacy seriously.  Our mission is to refresh the world and we can’t do that without your trust. This Privacy Policy explains what information we collect about you, why we collect the information, as well as how we collect and use the information so that we can deliver the best, most refreshing experience that we can. \n\nThis Privacy Policy is intended for individuals in the United States. If you live outside of the United States and choose to use the Sites connected with this Privacy Policy, you do so at your own risk and understand that your information will be sent to and stored in the United States. By using any of our websites and mobile applications in the United States that contain a link to this Privacy Policy (collectively, “Sites”) or otherwise providing Personal Information to us, you agree to this Privacy Policy. Note that there may be other websites that reference the Coca-Cola brand but are subject to a different privacy policy."
